import React from 'react';

export const TENSORFLOW_JS = 'tensorflow';
export const ARRAY_SORT = 'tensorflow';
export const COCO = 'tensorflow';
export const NIGHT = 'night';

interface modalStateInterface{
	tensorflow: boolean,
	arraySort: boolean,
	coco: boolean
}

export const initialModalState:modalStateInterface = {
	tensorflow: false,
	arraySort: false,
	coco: false
};
